window.bookSummaryJSON = "<p><b>An Instant New York Times Best Seller</b></p> <p><b>The award-winning DC Icons story of the world's greatest super hero: </b><b><i>Wonder Woman </i></b><b>by the number one </b><b><i>New York Times</i></b><b> best-selling author Leigh Bardugo.</b></p> <p>\"You’ll enjoy this book whether you’re a fan of Wonder Woman comics, the Wonder Woman movie, Leigh Bardugo, or just YA lit in general.\" (<i>Hypable</i>) </p> <p>She will become one of the world's greatest heroes: Wonder Woman. But first she is Diana, princess of the Amazons. And her fight is just beginning....</p> <p>Diana longs to prove herself to her legendary warrior sisters. But when the opportunity finally comes, she throws away her chance at glory and breaks Amazon law - risking exile - to save a mere mortal. Even worse, Alia Keralis is no ordinary girl and with this single brave act, Diana may have doomed the world.</p> <p>Alia just wanted to escape her overprotective brother with a semester at sea. She doesn't know she is being hunted. When a bomb detonates aboard her ship, Alia is rescued by a mysterious girl of extraordinary strength and forced to confront a horrible truth: Alia is a Warbringer - a direct descendant of the infamous Helen of Troy, fated to bring about an age of bloodshed and misery. Together, Diana and Alia will face an army of enemies - mortal and divine - determined to either destroy or possess the Warbringer. If they have any hope of saving both their worlds, they will have to stand side by side against the tide of war.</p> <p>\"Feminism is the invisible jet powering this literary revamp of the Amazon princess.\" (<i>The New York Times Book Review</i>)</p> <p>\"Warning: This novel about the young super hero crossing paths with a seemingly ordinary - but seriously powerful - girl may result in multiple fist pumps.\" (<i>Seventeen</i>)</p> <p>Don't miss the rest of the DC Icons series! Listen in any order you choose:</p> <p></p> <ul> <li><i>Batman: Nightwalker </i>by Marie Lu</li> <li><i>Catwoman: Soulstealer</i> by Sarah J. Maas</li> <li><i>Superman: Dawnbreaker</i> by Matt de la Peña</li> </ul>"; 
